// src/components/GetAllFlights.tsx
import React, { useState, useEffect } from 'react';
import { getAllFlights } from '../api';

const GetAllFlights: React.FC = () => {
  const [flights, setFlights] = useState<any[]>([]);

  useEffect(() => {
    const fetchFlights = async () => {
      try {
        const response = await getAllFlights();
        setFlights(response.data);
      } catch (error) {
        console.error(error);
      }
    };

    fetchFlights();
  }, []);

  return (
    <div>
      <h2>All Flights</h2>
      <ul>
        {flights.map((flight) => (
          <li key={flight.id}>
            Flight ID: {flight.id} - Origin: {flight.origin} - Destination: {flight.destination} - Departure Date: {flight.departureDate} - Price: ${flight.price} - Available Seats: {flight.availableSeats}
          </li>
        ))}
      </ul>
    </div>
  );
};

export default GetAllFlights;
